import numpy as np
def error_prone(sequence):
    for i in range(3):
        str1000 = sequence[:(i + 1)*5000]
        errorSum = str1000.count('ATA') + str1000.count('TAT') + str1000.count('GAC') + str1000.count(
        'CAC') + str1000.count('GTC') + str1000.count('GTG') + str1000.count('GCG') + str1000.count(
        'AAA') + str1000.count('TTT') + str1000.count('CCC') + str1000.count('CGC') + str1000.count('GGG')
        print(errorSum)

def GC_content(seq):
    variance = []
    for i in range(40):
        content = 0
        temp = seq[i*15:(i+1)*15]
        for j in range(10):
            if temp[j] == "A" or  temp[j] == "T" :
                content = content + 1
        content = content/10
        variance.append(content)
    var = np.var(variance)
    return var
